import React from "react";
import { TodoIcon } from "./TodoIcon";

function CompleteIcon({completed, onCompleted}) {
  return (
    <TodoIcon 
      type="check"
      color={completed ? "green" : "gray"}
      onCompleted={onCompleted}
    />
  );
}

export { CompleteIcon };
